function submit() {
	var username = document.getElementById("username").value;
	var password = document.getElementById("password").value;
	
	if(!username || !password) {
		alert("Invalid Username/Password");
		return;
	}
		
	//This would ideally communicate with some manner of SQL server not exposed to the user, but out of scope for GUI class.
	//In exchange, we do this terribleness with regex to simulate the result that we want.
	
	//grab hash and salt from DB
	var xhttp = new XMLHttpRequest();
	xhttp.onerror = function(x) {
		attemptLogin(null, username, password);
	}
    xhttp.onreadystatechange = function() {
		if(this.readyState == 4 && this.status == 200)
			attemptLogin(this.responseText, username, password);			
	}
	xhttp.open("GET", "util/login.txt", true); 
    xhttp.send(); 
}

